import React, { Component } from 'react';
import { createStore } from 'redux';

import reducer from './reducers';

import BankAccountPreview from './BankAccountPreview';
import BankAccountActions from './BankAccountActions';
import './App.css';

const initialState = { name: "Janny", balance: "2,500,701"}
const store = createStore(reducer, initialState);

class App extends Component {
  render() {
    return (
      <div className="App">
        <BankAccountPreview 
          name={store.getState().name} 
          balance={store.getState().balance}
        />
        <BankAccountActions 
          actionList={['WITHDRAW_10000', 'WITHDRAW_5000', 'GIVE_ALL_TO_CHARITY']}
        />
      </div>
    );
  }
}

export default App;
